import React, { useState, useEffect } from 'react';

function ParkingManagement() {
  const [spaces, setSpaces] = useState([]);
  const [vehicles, setVehicles] = useState([]);

  useEffect(() => {
    // Aquí puedes hacer una petición a tu backend para obtener los espacios y vehículos
    // Por ahora, usaré datos simulados
    setSpaces([
      { id: 'A1', estado: 'Libre', discapacitado: false },
      { id: 'A2', estado: 'Ocupado', discapacitado: false }
    ]);
    setVehicles([{ owner: 'John Doe', plate: 'ABC123' }]);
  }, []);

  return (
    <div>
      <h1>Gestión de Estacionamiento</h1>
      <table>
        <thead>
          <tr>
            <th>Espacio</th>
            <th>Estado</th>
            <th>Discapacitado</th>
          </tr>
        </thead>
        <tbody>
          {spaces.map(space => (
            <tr key={space.id}>
              <td>{space.id}</td>
              <td>{space.estado}</td>
              <td>{space.discapacitado ? 'Sí' : 'No'}</td>
            </tr>
          ))}
        </tbody>
      </table>
      <h2>Vehículos</h2>
      <table>
        <thead>
          <tr>
            <th>Propietario</th>
            <th>Patente</th>
          </tr>
        </thead>
        <tbody>
          {vehicles.map((vehicle, index) => (
            <tr key={index}>
              <td>{vehicle.owner}</td>
              <td>{vehicle.plate}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}

export default ParkingManagement;
